import { useEffect, useState } from "react";
import { fetchItems } from "./api"; // Import fetch function

const ItemsList = () => {
    const [items, setItems] = useState([]);

    useEffect(() => {
        const getItems = async () => {
            const data = await fetchItems();
            if (data) {
                setItems(data);
            }
        };

        getItems();
    }, []);

    return (
        <div>
            <h1>Items List</h1>
            <ul>
                {items.map((item) => (
                    <li key={item.id}>
                        {item.name} - ${item.price}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ItemsList;
